import React from "react";

class Education extends React.Component {
  render() {
    return (
      <div
        id="education"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Education</div>
        </div>
        <div className="container">
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <div
              className="card"
              data-aos="zoom-in"
              style={{
                backgroundColor: "#F8DD74",
                width: "600px",
                height: "150px",
                border: "none",
                marginBottom: "20px",
                display: "flex",
                flexDirection: "row",
                justifyContent: "space-around",
                alignItems: "center",
              }}
            >
              <div><img src={require("../")}/></div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <div>name </div>
                <div>location</div>
              </div>
            </div>
            <div
              className="card"
              data-aos="zoom-in"
              style={{
                backgroundColor: "#F8DD74",
                width: "600px",
                height: "150px",
                border: "none",
                marginBottom: "20px",
                display: "flex",
                flexDirection: "row",
                justifyContent: "space-around",
                alignItems: "center",
              }}
            >
              <div>logo</div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <div>name </div>
                <div>location</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const MainDiv = {
  marginTop: "70px",
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

export default Education;
